import { React, useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import {  Table} from "semantic-ui-react";
import JobAdvertService from "../services/JobAdvertService";
export default function EmployerDetails() {
  const [jobAdverts, setJobAdverts] = useState({});
  let { id } = useParams();
  useEffect(() => {
    let jobAdvertService = new JobAdvertService();
    jobAdvertService
      .getByIsActiveTrueAndEmployerId(id)
      .then((result) => {
        setJobAdverts(result.data.data);
      });
  }, [id]);
  console.log(jobAdverts);
  return (
    <div>
        {jobAdverts.map((jobAdvert)=>(
          jobAdvert.array.forEach(element => {
            <h1 key={jobAdvert.id}>{element.jobAdvert.numberOfPosition}</h1>
          })
        ))}
    </div>
  )
}
